func lastVisitedIntegers(words []string) []int {
    var result []int
    var nums []int
    consecutivePrev := 0

    for _, word := range words {
        if word == "prev" {
            consecutivePrev++
            if consecutivePrev <= len(nums) {
                // Get the last visited integer based on the number of consecutive "prev"
                result = append(result, nums[len(nums)-consecutivePrev])
            } else {
                // If k is greater than the total visited integers, append -1
                result = append(result, -1)
            }
        } else {
            // Convert word to integer and add to nums
            val, _ := strconv.Atoi(word)
            nums = append(nums, val)
            consecutivePrev = 0 // Reset consecutivePrev counter
        }
    }

    return result
}
